import React, { useState, useEffect, useRef } from 'react';
import Navbar from '../../components/Common/Navbar';
import LogoutButton from '../../components/Common/LogoutButton';
import UserInfo from '../../components/Common/UserInfo';
import axios from 'axios';
import io from 'socket.io-client';
import SimplePeer from 'simple-peer';

const socket = io.connect('http://172.30.1.40:7000'); // 신호 서버 주소

function MapCreatePage() {
    const [robots, setRobots] = useState([]);
    const [selectedRobot, setSelectedRobot] = useState('');
    const videoRef = useRef();
    const slamRef = useRef();
    const [peer, setPeer] = useState(null);

    useEffect(() => {
        const fetchRobots = async () => {
            try {
                const token = localStorage.getItem('token');
                const response = await axios.get('http://172.30.1.40:5559/robot/robots', {
                    headers: { Authorization: `Bearer ${token}` }
                });
                setRobots(response.data);
            } catch (error) {
                console.error('Error fetching robots:', error);
            }
        };

        fetchRobots();

        // WebSocket 이벤트 설정
        socket.on('signal', data => {
            if (peer) {
                peer.signal(data);
            }
        });

        return () => {
            socket.disconnect();
        };
    }, [peer]);

    useEffect(() => {
        if (selectedRobot) {
            // Peer 객체 초기화 및 설정
            const p = new SimplePeer({
                initiator: true,
                trickle: false
            });

            p.on('signal', data => {
                socket.emit('signal', { signal: data, robot_id: selectedRobot });
            });

            p.on('stream', stream => {
                if (videoRef.current) {
                    videoRef.current.srcObject = stream;
                }
            });

            setPeer(p);
        }
    }, [selectedRobot]);

    const sendCommand = (command) => {
        const token = localStorage.getItem('token');
        fetch('http://172.30.1.40:5559/robot/send_command', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
                'Authorization': `Bearer ${token}`
            },
            body: JSON.stringify({
                robot_id: selectedRobot,
                command: command
            })
        }).then(response => response.text())
            .then(data => alert(data))
            .catch(error => console.error('Error sending command:', error));
    };

    const handleKeyDown = (e) => {
        const velocityCommands = {
            w: { linear: 0.1, angular: 0 },
            a: { linear: 0, angular: 0.1 },
            s: { linear: -0.1, angular: 0 },
            d: { linear: 0, angular: -0.1 },
            ' ': { linear: 0, angular: 0 }
        };
        if (velocityCommands[e.key]) {
            if (peer) {
                peer.send(JSON.stringify({
                    robot_id: selectedRobot,
                    velocity: velocityCommands[e.key]
                }));
            }
        }
    };

    useEffect(() => {
        window.addEventListener('keydown', handleKeyDown);
        return () => {
            window.removeEventListener('keydown', handleKeyDown);
        };
    }, [selectedRobot, peer]);

    return (
        <div>
            <header>
                <UserInfo />
                <LogoutButton />
            </header>
            <div style={{ display: 'flex' }}>
                <Navbar />
            </div>
            <h2>SLAM Control</h2>
            <div>
                <label>로봇 선택:</label>
                <select onChange={(e) => setSelectedRobot(e.target.value)} value={selectedRobot}>
                    <option value="">로봇을 선택하세요</option>
                    {robots.map(robot => (
                        <option key={robot._id} value={robot._id}>{robot.name}</option>
                    ))}
                </select>
            </div>
            <button onClick={() => sendCommand('slam')}>SLAM 시작</button>
            <button onClick={() => sendCommand('teleop')}>Teleop 시작</button>
            <div style={{ display: 'flex', justifyContent: 'space-between' }}>
                <div>
                    <h3>SLAM 화면</h3>
                    <img ref={slamRef} src={`http://${selectedRobot}:8080/stream?topic=/camera/rgb/image_raw`} alt="SLAM View" />
                </div>
                <div>
                    <h3>WebCam 화면</h3>
                    <video ref={videoRef} autoPlay playsInline />
                </div>
            </div>
        </div>
    );
}

export default MapCreatePage;
